import React from 'react';

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <div className="logo">
<h1 className="logo-text text-left">Saqlain Sheikh</h1>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
